import { useState } from "react";
import backgroundVid from "../videos/giphy.mp4"

const home = () => {
    return (
        <>
            <div className="h-screen w-full bg-[#000000]">
                <video autoPlay loop className="object-cover min-w-full h-screen">
                    <source src={ backgroundVid }/>
                </video>
            </div>
        </>
    )
}

export default home;
